    }

    render() {
        return (
            <nav className="main-nav">
                <h1>{this.props.title}</h1>
                <section className="right-nav">
                    <a href="/">API Docs</a>
                    <div>{ this.props.username }</div>
                    <a href="/">Log Out</a>
                </section>

                {/* Navigation Links */}
            </nav>
        )
    }
}

export default NavBar;
